import { motion } from 'framer-motion';
import React from 'react';

// Animated circle component that moves along a path
const AnimatedCircleAlongPath = ({
  path,
  delay = 0,
  duration = 1.5,
  ...props
}: React.ComponentProps<typeof motion.circle> & {
  path: string;
  delay?: number;
  duration?: number;
}) => (
  <g>
    <motion.circle
      {...props}
      style={
        {
          offsetPath: `path('${path}')`,
          offsetRotate: 'auto',
          offsetDistance: 'var(--offset)',
        } as React.CSSProperties
      }
      // eslint-disable-next-line @typescript-eslint/no-explicit-any -- CSS custom properties are not typed in React's CSSProperties
      initial={{ '--offset': '0%' } as any}
      // eslint-disable-next-line @typescript-eslint/no-explicit-any -- CSS custom properties are not typed in React's CSSProperties
      animate={{ '--offset': '100%' } as any}
      transition={{
        duration,
        repeat: Infinity,
        ease: 'easeInOut',
        delay: 0,
        repeatDelay: delay,
      }}
    />
  </g>
);

